    false,nt"url": null,nt"notes": "This narrative report for Lake Andes Wetland
    Management District outlines Refuge accomplishments during the 1976 calendar year.
    The report begins with an introduction to the Refuge and information about weather
    conditions, habitat conditions, land acquisition activities, and the system status.
    Construction and maintenance are also described. Habitat management is covered;
    croplands, grasslands, forests, and easements for waterfowl management are discussed.
    The wildlife section of the report discusses endangered and threatened species,
    migratory birds, and mammals. Interpretation and recreation activities are outlined;
    topics include recreation and law enforcement. Field investigations and cooperative
    programs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
